import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load and extract prices
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Extract all product prices using multiple selector strategies
    const prices = await page.$$eval('.product-price', priceElements => 
      priceElements.map(el => {
        const priceText = el.textContent.trim();
        // Extract numeric price values using regex
        const priceMatch = priceText.match(/\$(\d+\.\d{2})/);
        return priceMatch ? parseFloat(priceMatch[1]) : null;
      }).filter(price => price !== null)
    );

    // Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_extracted.png'));

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData: { prices },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
